import React from 'react';
import styles from './Recipient.module.css';
import RecipientProfilePhoto from '../../Assets/ian-robinson.png';

const Recipient = () => (
  <div className={styles.container}>
    <img className={styles.recipientProfilePhoto} alt="Ian Robinson" src={RecipientProfilePhoto} />
    <div className={styles.labelContainer}>
      <p className={styles.nameText}>Ian Robinson</p>
      <p className={styles.descriptionText}>Enter Amount to Pay</p>
    </div>
  </div>
);

export default Recipient;
